import React from 'react';
import { Bell, User } from 'lucide-react';

const Header = () => {
  return (
    <header className="bg-white border-b border-gray-200 py-4 px-6 flex items-center justify-between">
      <h1 className="text-xl font-bold text-gray-800">GroceryMate</h1>
      <div className="flex items-center space-x-4">
        <button className="relative p-2 text-gray-500 hover:text-gray-700">
          <Bell size={20} />
          <span className="absolute top-0 right-0 h-4 w-4 bg-emerald-500 rounded-full flex items-center justify-center text-xs text-white">3</span>
        </button>
        <button className="flex items-center text-gray-500 hover:text-gray-700">
          <User size={20} />
          <span className="ml-2 text-sm text-gray-800">Morgan Edwards</span>
        </button>
      </div>
    </header>
  );
};

export default Header;
